type PersonListprops={
    name:{fname:string
    lname:string}[]
}
export const PersonList=(props:PersonListprops)=>{
    return(
        <div>
        {props.name.map((name)=>{return(
            <h2 key={name.fname}>{name.fname} {name.lname}</h2>)

        })}
        </div>
    )
}
